import java.util.Arrays;import java.util.Collections;import java.util.HashSet;import java.util.List;import java.util.stream.Collector;import java.util.stream.Collectors;public class DuplicateNumber {    public static void main(String[] args) {        List<Integer> list = Arrays.asList(1,2,2,3,4,5,6,6,7,8,8);        System.out.println("Remove Duplicate Use Frequency : " + list.stream()                .filter(e-> Collections.frequency(list , e) > 1).collect(Collectors.toSet()));        HashSet<Integer> dupNum= new HashSet<>();        System.out.println("Remove Duplicate Use Hash Map: " +list.stream()                .filter(e -> !dupNum.add(e))                .collect(Collectors.toSet()));    }}